import React from 'react'

import '../../index.css'
import './ListTODO.css'

import NewTODO from '../NewTODO/NewTodo'

const ListTODO = props => {
	return (
		<div className='list wrapper'>
			<h2 className='list__title'>
				Farm's TODO <i className='fa-solid fa-wheat-awn'></i>
			</h2>
            {}
			{/* <h2 className='list__subtitle'>No any Farm's TODO</h2>  */}
			<div className='list__todo'>
				{props.items.map(todo => (
					<NewTODO key={Math.random().toString()} title={todo.title} date={todo.date} message={todo.message} category={todo.category} />
				))}
			</div>
		</div>
	)
}

export default ListTODO
